import React from 'react';
import {Button, Card} from 'react-bootstrap';

export default function DoraList(props) {
    let cardList = props.darayaki.map((singleData, index) => {
      return <DoraCard infoDisplay={singleData} key={index} />;
    })

    return (
      <div className="row">
        {cardList}
      </div>
    );
  }

function DoraCard(props) {
  let dora = props.infoDisplay;

  return (
    <div className="column col-md-6 col-xl-4">
      <Card>
        <Card.Img className="card-img" variant="top" src="img/cardImg.png" />
        <Card.Body>
          <Card.Title>{dora.title}</Card.Title>
          <Button variant="primary">Button Label</Button>

          <Card.Text className='desc1'>
              <p className='desc'>{dora.desc1}</p>
              <p>Description</p>
          </Card.Text>

          <Card.Text className='desc2'>
              <p className='desc'>{dora.desc2}</p>
              <p>Description</p>
          </Card.Text>

        </Card.Body>
      </Card>
    </div>

  );
}
